import './App.css';
import DiaryEditor from './DiaryEditor';
import DiaryList from './DiaryList';


const dummyList = [
  {
    id: 1,
    author:"자밀",
    content: "하이 1",
    emotion:5,
    create_date: new Date().getTime()
  },
    {
    id: 2,
    author:"자밀",
    content: "하이 1",
    emotion:5,
    create_date: new Date().getTime()
  },
    {
    id: 3,
    author:"자밀",
    content: "하이 1",
    emotion:5,
    create_date: new Date().getTime()
  },
    {
    id: 1,
    author:"자밀",
    content: "하이 1",
    emotion:5,
    create_date: new Date().getTime()
  },
];

function App() {
  return (
    <div className="App">
      <DiaryEditor/>
      <DiaryList/>
    </div>
  );
}

export default App;
